def filewriter(filename,row, filter = 1): 
	file = open (filename,"a")
	row = str(row)
	rejections = ["?np=y","http://www.sciencedirect.com/science/article/pii/","mailto:","[","]","'",'"']
	
	if filter == 1: 
		for rejection in rejections:
			row = row.replace(rejection,"") 
	file.write(str(row))
	file.write('\n')

